import React, { useContext } from 'react';

// State
import { TodoContext } from "../context/TodoProvider";

// Comnponents
import AddTodo from "./AddTodo";

const List = props => {
    const { list } = useContext(TodoContext);
    return (
        <div>
            <AddTodo />
            {list.todos.map((item, i) => {
                return <div key={i}>{ item }</div>
            })}
        </div>
    )
}

export default List;
